use clap::Parser; // 定义 httpie 的 CLI 的主入口，它包含若干个子命令
// 下面 /// 的注释是文档，clap 会将其作为 CLI 的帮助 /// A naive httpie implementation with Rust, can you imagine how easy it is?
#[derive(Parser, Debug)]
#[clap(version = "1.0", author = "Tyr Chen <tyr@chen.com>")]
struct Opts { #[clap(subcommand)] subcmd: SubCommand,
} // 子命令分别对应不同的 HTTP 方法，目前只支持 get / post
#[derive(Parser, Debug)]
enum SubCommand { Get(Get), Post(Post), // 我们暂且不支持其它 HTTP 方法
} // get 子命令 /// feed get with an url and we will retrieve the response for you
#[derive(Parser, Debug)]
struct Get { /// HTTP 请求的 URL url: String,
} // post 子命令。需要输入一个 url，和若干个可选的 key=value，用于提供 json body /// feed post with an url and optional key=value pairs. We will post the data
/// as JSON, and retrieve the response for you
#[derive(Parser, Debug)]
struct Post { /// HTTP 请求的 URL url: String, /// HTTP 请求的 body body: Vec<String>,
} fn main() { let opts: Opts = Opts::parse(); println!("{:?}", opts);
} 要点说明 clap::Parser clap::Parser clap-rs/clap: A full featured, fast Command Line Argument Parser for Rust clap - Rust clap::parser - Rust clap的parser派生宏会自动实现parse方法来接收指令参数 struct Opts { #[clap(subcommand)] subcmd: SubCommand,
